import { useQuery } from "@apollo/client";
import gql from "graphql-tag";

const SINGLE_GUITAR_QUERY = gql`
  query {
    Guitar(where:{
      id:"605bc9f0fb84278ed730b5aa"
    }) {
      name
      price
      description
    }
  }
`;

export default function SingleGuitar({ query }) {
  const { data, loading, error } = useQuery(SINGLE_GUITAR_QUERY);
  return (
    <p>Hey I'm a single product {query.id}</p>
  )
}
